package puzzle;

import static java.util.Arrays.asList;
import static java.util.stream.Collectors.toList;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;
import org.junit.Test;

public class Day5 {

    List<String> reactions = Arrays.stream("abcdefghijklmnopqrstuvwxyz".split(""))
            .flatMap(letter -> asList(letter + letter.toUpperCase(), letter.toUpperCase() + letter).stream())
            .collect(toList());

    String prodPolymer = "";
    String testPolymer = "dabAcCaCBAcCcaDA";

    @Test
    public void run() {
        String poly = prodPolymer;

        String result = react(poly);
        System.out.println("Rected polymer length: " + result.length());
        System.out.println("Rected polymer: " + result);

        List<List<String>> reactionsList = Arrays.stream("abcdefghijklmnopqrstuvwxyz".split(""))
                .map(letter -> asList(letter, letter.toUpperCase()))
                .collect(toList());
        List<Integer> lengths = new ArrayList<>();

        for (String unitToRemove : "abcdefghijklmnopqrstuvwxyz".split("")) {
            poly = prodPolymer.replaceAll(unitToRemove, "").replaceAll(unitToRemove.toUpperCase(), "");
            result = react(poly);
            lengths.add(result.length());
            System.out.println("Removing " + unitToRemove + " and " + unitToRemove.toUpperCase()
                    + " got reacted polymer of length: " + result.length());
        }

        System.out.println("Shortest polymer is: " + lengths.stream().min(Integer::compareTo));
    }

    private String react(String poly) {
        boolean reacted = true;
        int reactionsCount = 0;

        while (reacted) {
            reacted = false;
            for (String reaction : reactions) {
                String r = poly.replaceAll(reaction, "");
                if (!r.equals(poly)) {
                    reacted = true;
                    reactionsCount++;
                    poly = r;
                }
            }
        }
        System.out.println("Count of reactions: " + reactionsCount);

        return poly;
    }

}
